import styles from './styles.module.scss'

interface PropsButton {
  type: any
  btnName: string
  onClick?: () => void
}

export function Button(props: PropsButton) {
  return (
    <button
      type={props.type}
      className={styles.btn}
      disabled={props.disabled}
      onClick={props.onClick}
    >
      {props.btnName}
    </button>
  )
}
